import React from 'react';
import './App.css';

function InputForm() {
  return(
    <form>
      <input 
        type="text"
        placeholder="Ene"
      />
    </form>
  );
}

function Card() {
  return(
    <div className="github-profile">
      one github
    </div>
  );
}

function Header(props) {
return (<div className="header">{props.title}</div>);
}

function App() {
  return (
    <div>
      <Header title="The Github Card App"/>
      <Card />
    </div>
  );
}

export default App;
